import './WhatWeDo.css';

import { Col, Container, Row } from "react-bootstrap";

function WhatWeDo(){

    const ArraysWhatWeDo = [{
        id: 1,

    }];
    const ArraysWhatWeDoOnMap = ArraysWhatWeDo.map((ArrayWhatWeDo) =>
    <Col key = {ArrayWhatWeDo.id} lg = "4" md = "6" sm = "12">
        <img src = {ArrayWhatWeDo.image} className = "w-100"/>
        <h1>{ArrayWhatWeDo.title}</h1>
        <p>{ArrayWhatWeDo.text}</p>
        <a>{ArrayWhatWeDo.link}</a>
    </Col>
    )

    return(
        <Container fluid>
            <Container>
                <div className = "whatwedo border">
                    <p>What we do</p>
                    <h1>Our Services For Your Business</h1>

                    <Row>
                        {ArraysWhatWeDoOnMap}
                    </Row>
                </div>
            </Container>
        </Container>
    )
}

export default WhatWeDo
